import React from 'react';
import { Table, Card } from 'react-bootstrap';
import axios from 'axios';

export default class MyCards extends React.Component {
  constructor() {
    super();
    this.state = {
      categories: [],
    };
  }

  componentDidMount() {
    axios
      .get('http://localhost:8080/api/categories')
      .then(function (res) {
        console.log(res.data);
        this.setState(
          res.data.map((val) => {
            return (
              <th>
                <Card>
                  <Card.Body>Predoana</Card.Body>
                </Card>
              </th>
            );
          })
        );
      })
      .catch(function (error) {
        console.log(error);
      });
  }
  render() {
    return (
      <Table responsive>
        <thead>
          <tr>
            <th>{this.state.categories}</th>
          </tr>
        </thead>
      </Table>
    );
  }
}
